text_show:
Meie põhiväärtus ja edu võti on meie meeskond.
Ellex Raidlas saad sa töötada suurimate ja kõige rohkem väljakutset pakkuvate tehingute ja kaasustega, spetsialiseeruda erinevates praktikavaldkondades ning olla osa meie regiooni õigusajaloost. Siin leiad sa tööka ja sõbraliku meeskonna.
Me oleme uhked, et kõik Ellexi töötajad on oma ala asjatundjad, kelle jaoks on kõrge kvaliteet standard.
Me otsime pidevalt kõrgelt kvalifitseeritud ja kogenud õigusala asjatundjaid ning parimaid juuratudengeid, kes hindavad jätkuvat arengut, meeskonnatööd ja uuenduslikkust. Liitu meie meeskonnaga!
Ootame sind meie meeskonnaga liituma, kui:
• professionaalne areng on sinu elustiil ja sa jagad meie väärtusi;
• sa soovid töötada oma valdkonna parimate asjatundjatega;
• su eesmärk on olla parim;
• sul on rahvusvahelisi kogemusi.
Me pakume:
• edukat karjääri koos parimate õigusala asjatundjatega;
• võimalust omandada rohkem teadmisi, mis aitavad klienti paremini mõista;
• võimalusi õppimiseks ja professionaalseks arenguks;
• dünaamilist ja motiveerivat töökeskkonda;
• konkurentsivõimelist tasu.
